              "type": "lab.html.Page",
              "items": [
                {
                  "type": "text",
                  "content": "\u003Cp\u003E練習お疲れ様でした。本番試行に入る前に、もう一度手順を説明します。\u003C\u002Fp\u003E\n\u003Cp\u003Eこのタスクでは、2つの単語が提示され、それらについて比較するよう求められます。\u003C\u002Fp\u003E\n\u003Cn\u003Eキーボードの”Fキー”、”Jキー”、”spaceキー”を使います。\u003C\u002Fn\u003E\n\u003Cp\u003Eタスク時には、左手の人差し指を”Fキー”、右手の人差し指を”Jキー”、親指を”spaceキー”に置いて、回答をしてください。\u003C\u002Fp\u003E\n\n\u003Cn\u003Eまた、タスクは音声で呈示されます。なるべく静かな環境で、イヤホンをつけて行ってください。\u003C\u002Fn\u003E\n\u003Cn\u003Eまた、音声刺激がはっきりと聴こえるよう、ご使用のPC機器を調整ください。\u003C\u002Fn\u003E\n\n\u003Cp\u003E＜タスクの説明＞\u003C\u002Fp\u003E\n\n\u003Cp\u003E・”ready?”の画面で\"spaceキー\"を押すと、試行が始まります。\u003C\u002Fp\u003E\n\n\u003Cp\u003E・注視点のあと、\"どちらが〇〇ですか？ \"（例：「どちらが大きいですか？」）のような質問文が流れます。\nそのあとに流れる2つの選択肢から質問文に合うものを選んでください。\u003C\u002Fp\u003E\n\n\u003Cp\u003E１つめに流れてきた単語を選びたい場合は、「f」キーを押します。\u003C\u002Fp\u003E\n\n\u003Cp\u003E２つ目に流れてきた単語を選びたい場合は、「j」キーを押します。\u003C\u002Fp\u003E\n\n\u003Cp\u003E \u003Cb\u003E回答はできるだけ早く、正確に行ってください。\u003C\u002Fb\u003E \u003C\u002Fp\u003E\n\n\u003Cn\u003Eそれでは、本番試行を始めましょう。\u003C\u002Fn\u003E\n準備ができたら、下の”本番試行を始める”をクリックしてください。",
                  "title": "２つの単語を比較し、素早く反応する課題"
                }
              ],
              "scrollTop": true,
              "submitButtonText": "本番試行を始める  →",
              "submitButtonPosition": "right",
