                  "title": "課題説明－練習試行ー",
                  "content": "\u003Cp\u003E画面上に「\u003Cspan style=\"color:gray\"\u003E灰\u003C\u002Fspan\u003E」や「\u003Cspan style=\"color:pink\"\u003E桃\u003C\u002Fspan\u003E」のように、色名がさまざまな色で表示されます。\u003C\u002Fp\u003E\n\u003Cp\u003E\u003Cstrong\u003Eこのとき、文字の意味と文字の色が一致しているかどうか\u003C\u002Fstrong\u003Eをできるだけ速く、かつ正確に判断してください。\u003C\u002Fp\u003E\n\u003Cp\u003Eルールは次の通りです：\u003C\u002Fp\u003E\n\u003Cul\u003E\n  \u003Cli\u003E\u003Cstrong\u003E「J」キー\u003C\u002Fstrong\u003Eと\u003Cstrong\u003E「F」キー\u003C\u002Fstrong\u003Eを使います。必ず両手の人差し指で操作してください。\u003C\u002Fli\u003E\n  \u003Cli\u003E文字と色が \u003Cstrong\u003E一致している\u003C\u002Fstrong\u003E → \u003Cstrong\u003E「J」キー\u003C\u002Fstrong\u003E\u003C\u002Fli\u003E\n  \u003Cli\u003E文字と色が \u003Cstrong\u003E不一致\u003C\u002Fstrong\u003E → \u003Cstrong\u003E「F」キー\u003C\u002Fstrong\u003E\u003C\u002Fli\u003E\n\u003C\u002Ful\u003E\n\u003Cp\u003E例えば：\u003C\u002Fp\u003E\n\u003Cul\u003E\n  \u003Cli\u003E\u003Cspan style=\"color:gray\"\u003E灰\u003C\u002Fspan\u003E → 一致しているので「J」\u003C\u002Fli\u003E\n  \u003Cli\u003E\u003Cspan style=\"color:pink\"\u003E灰\u003C\u002Fspan\u003E → 不一致なので「F」\u003C\u002Fli\u003E\n\u003C\u002Ful\u003E\n"
